                                        <div className="system-table" >
                                            <ul className="search-func"><li style={{margin:'10px'}}><Button type="primary" onClick={() => this.onAddNewShow()}><Icon type="plus-circle-o" />添加收款方式</Button></li></ul>
                                            <Table
                                                columns={this.makeColumns2()}
                                                className="my-table"
                                                scroll={{ x: 1600 }}
                                            dataSource={this.makeData(this.state.data)}
                                                pagination={{
                                                    total: this.state.total,
                                                    current: this.state.pageNum,
                                                    pageSize: this.state.pageSize,
                                                    showQuickJumper: true,
                                                    showTotal: (total, range) => `共 ${total} 条数据`,
                                                    onChange: (page, pageSize) => this.onTablePageChange(page, pageSize)
                                                }}
                                            />
                                        </div>
                                    </TabPane>
                                </Tabs>
                            </div>
                        </li>
                    </ul>
                </div>
                {/* 添加模态框 */}
                <Modal
                    title={this.state.addOrUp === 'add' ? '添加产品' : '修改产品'}
